const t=JSON.parse('{"key":"v-19d9e3be","path":"/network/f5/autoCfgBakToRomteSFTP.html","title":"通过shell脚本将f5配置备份至远端SFTP服务器","lang":"zh-CN","frontmatter":{"index":131,"icon":"f5","title":"通过shell脚本将f5配置备份至远端SFTP服务器","author":"小苹果儿","date":"2022-09-09T00:00:00.000Z","category":["网络"],"tag":["f5","配置备份"]},"headers":[],"git":{"createdTime":1662712279000,"updatedTime":1670735215000,"contributors":[{"name":"00D2","email":"shijinguosjg@gmail.com","commits":2}]},"readingTime":{"minutes":2.36,"words":709},"localizedDate":"2022年9月9日","filePathRelative":"network/f5/autoCfgBakToRomteSFTP.md","excerpt":"<blockquote>\\n<p><strong>该脚本目标可实现的效果为：</strong></p>\\n<ol>\\n<li>判断HA双机配置是否是同步状态;</li>\\n<li>如不同步可进行HA主备机判断，并进行配置同步;</li>\\n<li>配置同步完成后生成ucs配置文件（文件命令格式为设备主机名）；</li>\\n<li>将配置文件通过SCP方式传送至远端SFTP服务器;</li>\\n<li>在文件传输完成后，删除本地的文件。</li>\\n<li>搭配crontab实时配置的定时保存及上传。</li>\\n</ol>\\n<p><strong>脚本未完成及测试的部分：</strong></p>\\n<ol>\\n<li>待测试N+M集群时的同步状态判断</li>\\n</ol>\\n<p><strong>适用版本</strong>\\n该脚本仅在BIGIP V15版本进行了测试，其他版本未进行测试。</p>\\n</blockquote>"}');export{t as data};
